import React from 'react'
import "../About.css";

export const About = () => {
  return (
    <div>

    <h1>About Me</h1>
    <h2>Background</h2>
    <p>Previously : Accountancy Student (Dropped) <br />Present: Solidity Developer building new Dapps on Ethereum. <br />Interest: NFTs, Gaming Crypto, Defi, Meta  <br /> Looking  to work in a challenging environment for solving Real Life Problems using Blockchain.  </p>
    </div>
  )
}
